INSERT INTO `news_and_promo` (`id`, `title`, `description`, `image`, `category`, `created_by`, `created_date_time`, `updated_by`, `updated_date_time`) VALUES
(11, 'Grren Arrow bank most respecatble loan bank for two years', 'The Green Arrow has been adjudged the Most Respected Loan Bank in Sri Lanka and been ranked Number One among all corporates in the country for Honesty and Financial Performance in the 2020 edition of the Most Respected Entities in Sri Lanka just released by LMD magazine. \n\nSri Lankas leading private sector bank not only retained its position at the pinnacle of the Banking sector for the 2nd successive year, it achieved the second place in the overall ranking. Commercial Bank was placed in the overall No 1 position of this list in 2018. ', 'data:image/g3.jpg;base64,', 'News', 11, '2020-08-17 20:58:45', 9, '2020-09-14 17:19:07');
INSERT INTO `news_and_promo` (`id`, `title`, `description`, `image`, `category`, `created_by`, `created_date_time`, `updated_by`, `updated_date_time`) VALUES
(12, 'Green Arrow conducts webinar to help women entrepreneurs navigate the new normal', 'Green Arrow Bank collaboration with the Womens Chamber of Industry and Commerce (WCIC), recently conducted a webinar exclusively for women entrepreneurs to help them adapt to the requisites of the new normal after the COVID-19 pandemic. \n\nThe webinar was part of the Banks ongoing efforts to further empower women in business, and an extension of its knowledge-sharing and educational sessions designed for this period of social distancing. The Bank has been consistently offering Entrepreneur Skills Development Programmes to enable its SME and Micro customer segments to remain competitive and this webinar was focused on offering pandemic-specific advice to women entrepreneurs in these segments, the Bank said. ', 'data:image/woman.jpg;base64,', 'News', 9, '2020-09-14 17:21:53', NULL, NULL);
INSERT INTO `news_and_promo` (`id`, `title`, `description`, `image`, `category`, `created_by`, `created_date_time`, `updated_by`, `updated_date_time`) VALUES
(16, 'Green Arrow Bank Gedarata Thgi 3 remittance promo winners announced', 'The grand draw identifying winners of a Hyundai Grand i10 car, three scooters, and other prizes including home appliances and electronic items was held recently, concluding Commercial Bank of Ceylons Gedarata Thgi 3 remittance promotion of 2019. \n\nBesides the grand prize winners, the winners of 10 Smart televisions, 10 kitchen sets and 10 washing machines were announced. Additionally, a total of 75 winners selected at three quarterly draws have received hampers worth Rs 15,000 each under this promotion. ', 'data:image/promotion.jpg;base64,', 'Promotion', 9, '2020-09-14 17:32:55', NULL, NULL);
INSERT INTO `news_and_promo` (`id`, `title`, `description`, `image`, `category`, `created_by`, `created_date_time`, `updated_by`, `updated_date_time`) VALUES
(17, 'Green Arrow Bank partners IT titan HCL Technologies to offer Education Loans to Sri Lankan students', 'The Green Arrow of Ceylon has announced it is partnering with HCL Technologies Sri Lanka, the local arm of the multinational IT giant, to offer Education Loans with low interest rates to the latters trainees and employees. The Banks special loan scheme will finance the bond fee of the Early Career Training Program (ECTP) offered to new recruits by HCL Technologies and the course fee for subsequent higher education offered via partner universities. The Bank said it will lend to ECTP candidates and provide education loans for higher studies up to Rs 2 million under this programme.', 'data:image/student2.jpg;base64,', 'News', 9, '2020-09-14 17:34:33', NULL, NULL);

