INSERT INTO `site_user_messages` (`id`, `name`, `email`, `message`, `created_date_time`) VALUES
(15, 'Yohan Jayasuriya', 'yohanjayasuriya01@gmail.com', 'The personal interest you took was exceptional and included you calling me twice to discuss in detail our requirements. You have given us good old fashioned service that is so rare these days.', '2020-08-03 18:26:41'),
(16, 'Vikum Perera', 'vikum1991@gmail.com', 'Fruit and Trees has provided an exceptional service', '2020-08-03 18:27:39'),
(17, 'Namala Kalum', 'NamalJaye01@gmail.com', 'I am still working flat out on my garden most days, removing tons of horrendous clay, laying paths, making a pergola, preparing more decent sized holes in which to plant trees etc., however, I feel compelled to write to you to say how pleased I am with the guidance given by you, and the care you took to ensure I knew what I was doing. I cannot believe there are many suppliers who take the trouble on a Sunday afternoon to sit their customer down for 45 minutes in his own lounge with his pad and pen in order to be provided with a set of key necessities, that you know will enable him to give his new trees the best chance of success possible.', '2020-08-03 18:28:54'),
(18, 'Tany Disanayaka', 'Tany@gmail.com', 'We would like to thank you for your help and wonderful guidance and instructions you sent us, both in choosing and caring for our banana tree.', '2020-08-03 18:30:38');

